export const TableBody = ({ transactions }) => {
  return (
    <tbody>
      $
      {transactions.map(({ id, type }) => {
        return id;
      })}
    </tbody>
  );
};

<tr>
  <td>Invoice</td>
  <td>125</td>
  <td>USD</td>
</tr>;
